<h2>SSCAIT 2016/17</h2>
<div>
   The 2016/17 installment of SSCAIT sported 45 participants. The tournament was divided into two divisions:
   <ul>
      <li><b>Student division</b>: Round Robin tournament of 1980 games, where everybody played two games against everybody else. 
         Only the individual student authors were eligible for the title.
      <li><b>Mixed division</b>: Elimination bracket of 16 best bots (including non-students and teams).
   </ul>
</div>
